import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useAction } from '../../hooks/useAction';

function Fourth() {
  const navigate = useNavigate();
  const { setMoney } = useAction();
  const { money } = useTypedSelector((state) => state.PariState);

  return (
    <div>
      <button onClick={() => navigate(-1)}>back</button>

      <div className="question">
        <p>How much are you willing to bet on this event?</p>
        <input value={money} onChange={(e) => setMoney(Number(e.target.value))} />
      </div>

      <button onClick={() => navigate('/q/4')}>next</button>
    </div>
  );
}

export default Fourth;
